      <div className="background">
        <img src="#" className="background1 graphics-backgrounds" alt="" />
        <img src="#" alt="" className="background2 graphics-backgrounds" />
      </div>

      <div className="section__text">
        <p className="section__text__p1">Hello, I'm</p>
        <h1 className="title">&lt;Indrajit/&gt;</h1>
        <p className="section__text__p2"><span id="element"></span></p>
        <div className="btn-container">
          <button className="btn btn-color-2 download" onClick={() => window.open('#')}>
